}

self {
	display: -webkit-box;
	-webkit-line-clamp: 1;
	-webkit-box-orient: vertical;
	overflow: hidden;
	text-overflow: ellipsis ;
	white-space: nowrap; 
	width: 280px;
}

self {
	position: fixed !important;
	left: 0 !important;
	right: 0 !important;
	top:0 !important;
	bottom: 0 !important;
	z-index:2;
}

@media only screen and (max-width: 1111px){
	self{
		display: flex !important;
		flex-direction: column-reverse !important;	
		align-items: center !important;
		align-self: center !important;
	}
}

self { position: relative; display: inline-block; }
self:hover .dropDownChild_ {display: block;
}

self { 
	position: absolute;
	display: none;
	background-color: #f1f1f1; 
	overflow: auto; 
	box-shadow: rgba(99, 99, 99, 0.2) 0px 2px 8px 0px;
	border-radius: 10px;
	z-index: 1; }

self .fd-selectbox__toggle_button, self .fd-input, self input{
	border: 1px solid red;
}

self >label>span{
	color: red;
}

self span~span {
	white-space: nowrap;
	text-overflow: ellipsis;
	width: 200px;
	display: block;
	overflow: hidden
}

@media screen and (max-width:1111px) {
	self span~span {
		width: 60px !important
		}

}

